  const [condition, setCondition] = useState(true);

  return (
    <div style={{ marginBottom: "30px" }}>
      <DNDNavbar />
      <DND showModal={showModal} onModalCancel={onModalCancel} />
      {condition ? (
        <div onClick={() => setCondition(false)}>
          <Else />
        </div>
      ) : (
        <DND2 />
      )}
    </div>
  );
};
export default Body;
